import { StatusBar } from 'expo-status-bar';
import React, { Component,useState }   from 'react';
import { StyleSheet, Text, View, TextInput, TouchableOpacity, Image,ImageBackground} from 'react-native';





export default class LogIn extends Component {
  
  constructor(props) {  
    super(props);  
    this.state = {parola: ''};  
    this.state= {username: ''}
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }




  componentDidMount() {
    fetch("https://api.example.com/items")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
   
    const { navigate } = this.props.navigation;
    let username=this.state.username;
    let parola=this.state.parola;

    function  f()
    {
      if(parola=="Mihai"&&username=="Mihai")
      navigate('Main')
      else alert("jvndfjkbdfbdfkb");
    }
  return (
  
    <ImageBackground source={require('./Imagini/bc.png')} style={styles.background}>
    <View style={styles.container}>
    {this.items.map(item => (
           console.log( item.nume)             
           
          ))}
    <Image source={require('./Imagini/logo.png')} />
    <View style={styles.input}>
    <Image source={require('./Imagini/ic_user.png')} style={styles.ic_user} />
      <TextInput style={styles.input1} placeholder="Username"   onChangeText={(username) => this.setState({username})  }></TextInput>
      </View>
    
      <View style={styles.input}>
      <Image source={require('./Imagini/ic_password.png')} style={styles.ic_user} />
      <TextInput style={styles.input2} placeholder="Parola" onChangeText={(parola) => this.setState({parola})  }  ></TextInput>
      </View>
      <View  style={styles.Btn}>
      <TouchableOpacity  style={styles.LoginBtn}   onPress={ f} >
     
        <Text style={styles.TextBtn}>Autentificare</Text>
      </TouchableOpacity>
      </View>
      <StatusBar style="auto" />
      

    </View>
    </ImageBackground>
  );
}
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
  // backgroundColor: '#fa1',
  flexDirection: "column",
  marginBottom:"36%",
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  },
  welcome:{
    fontSize:30,
    textAlign:'center',
    margin:10,
    color:'#000',
    
  },
  input1:{
    width:"70%",
    backgroundColor:"#ffff",
    padding:15,
    marginBottom:10 
  },
  input2:{
 
    width:"70%",
    backgroundColor:"#ffff",
    padding:15,
    marginBottom:10 ,
    
  },
  LoginBtn:{
    width:"45%",
    
    backgroundColor:"#ffff",
borderRadius:9,
    padding:15
  
    
  },
  TextBtn:{
    fontSize:18,
    textAlign:'center'
 
  },
  Btn:{
   
   // flexDirection:"row",
    justifyContent:"space-between"
  },
  background:{
    width:"100%",
    height:"100%"


  },
  input:
  {
    flexDirection:"row",
    justifyContent:"space-between",
   
  },
  

ic_user:{
